CREATE TABLE `mytable` (
  `id` BIGINT,
  `name.english` VARCHAR(1024),
  `name.japanese` VARCHAR(1024),
  `name.chinese` VARCHAR(1024),
  `name.french` VARCHAR(1024),
  `type` JSON,
  `base.HP` BIGINT NULL,
  `base.Attack` BIGINT NULL,
  `base.Defense` BIGINT NULL,
  `base.Sp. Attack` BIGINT NULL,
  `base.Sp. Defense` BIGINT NULL,
  `base.Speed` BIGINT NULL,
  `species` VARCHAR(1024),
  `description` VARCHAR(1024),
  `evolution.next` JSON NULL,
  `profile.height` VARCHAR(1024),
  `profile.weight` VARCHAR(1024),
  `profile.egg` JSON NULL,
  `profile.ability` JSON,
  `profile.gender` VARCHAR(1024),
  `image.sprite` VARCHAR(1024),
  `image.thumbnail` VARCHAR(1024),
  `image.hires` VARCHAR(1024) NULL,
  `evolution.prev` JSON NULL,
  `evolution` JSON NULL
);

